#Senha Automatica Diaria para Sistema da Fiorilli
"""
Sistema de Ensino
Sistema de Saude
Sistema de Assistente Social
"""


def relogio():
    tempo = datetime.now()
    horass = tempo.strftime("                                                                     Relogio:  %H:%M:%S")
    h1.config(text=horass)
    h1.after(200, relogio)

def bottao(): #Funcao para usar no Click do botao!
    current_time: datetime = datetime.now()
    dia = current_time.day
    ano = current_time.year     #Toda Funcao deve conter estes espacos para validar
    mes = current_time.month
    soma = dia + ano - mes
    senha = f'''
      SIS (Sistema Integradado Saude) - Senha: {soma}
      SAS (Sistema Assistente Social) - Senha: {soma}
      SIE (Sistema Integrado de Ensino) - Senha: {soma}'''
    msg_vaga["text"] = senha #msg_vaga sera editada o text='' dela para oq esta dentro da variavel senha
def sseWEB():
    sse = 'CXJ325'
